Есть два замечания:
1) Во время дебатов не было аргументированного объяснения почему поправки ещё не приняты (всё что услышал по этому поводу - кидались фразами приняты - не приняты, а так хотелось услышать дискуссию именно по поводу того, что поправки вступают в силу только в результате принятия на голосовании);
2) В этом ролике было сделано замечание, что Навальный несколько неверно подсчитал результаты опросов, однако и вы несколько манипулируете данными, не включая в расчёты воздержавшихся от опроса, если их учесть, то получается только 60% против, остальные воздержались или за (специально заглянул в тот ролик и сделал расчёты). Для большей верности в будущем попрошу или более верно считать или указывать что это процент среди давших ответ.

