@PleasePleaseMe сорвать голосование - это как раз активное действие. И возможности такие есть. Есть эпидемия. Есть письмо членов избиркомов, отказывающихся проводить мероприятие. У нас в области таких 6 человек и их сейчас активно прессуют. 
А вот просто идти как бараны, куда хунта вас поманит - это точно не активное действие. Пойдете вы или нет, результат заранее нарисован. Хотите - идите, но не стоит считать, что просто сходив туда, куда хунта вас пригласила, вы выполнили свой долг или сделали доброе дело. Ничего вы не сделали. Эффект от вашего голоса - ноль. действие, у которого результат ноль - это бессмысленное действие.
И. Хотя, все знают, любят и уважают товагища Бгонштейна, но будьте осторожны. Посмотрите когда активизировался его канал, тихо спавший много лет...

